import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const Landing = () => {
  return (
    <Box
      sx={{
        minHeight: 'calc(100vh - 64px)', // Adjust if navbar height is different
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'linear-gradient(135deg, #0D47A1 0%, #1976D2 100%)', // Professional and calming blue gradient
        color: 'white',
        textAlign: 'center',
        p: 3,
      }}
    >
      <Container maxWidth="md">
        <Typography
          variant="h2"
          component="h1"
          gutterBottom
          sx={{ fontWeight: 'bold' }}
        >
          The Future of Integrative Medicine is Collaborative.
        </Typography>
        <Typography variant="h5" component="p" sx={{ my: 3, opacity: 0.9 }}>
          Soul.AI provides a secure, intelligent platform for conventional doctors and AYUSH specialists to deliver holistic patient care, together.
        </Typography>
        <Button
          variant="contained"
          component={Link}
          to="/register"
          size="large"
          sx={{ 
            mt: 4, 
            backgroundColor: 'white', 
            color: '#1976D2',
            '&:hover': {
              backgroundColor: '#f0f0f0',
            }
          }}
        >
          Join the Network
        </Button>
      </Container>
    </Box>
  );
};

export default Landing;
